import React from 'react';
import './App.css';

function Inicio() {
  return (
    <div className="app-container">
      {/* Contenedor Principal */}
      <section className="video-container">
        <h2>Bienvenido a Drivin</h2>
        <p>Conoce nuestros servicios</p>
        <div className="video-box">
          <video className="video-player" controls>
            <source src="/videos/intro-video.mp4" type="video/mp4" />
            Tu navegador no soporta el elemento de video.
          </video>
        </div>
      </section>

      {/* Otro Contenedor */}
      <section className="features-container">
        <h2>Características de Drivin</h2>
        <div className="feature-box">
          <video className="video-player" controls>
            <source src="/videos/feature-video.mp4" type="video/mp4" />
            Tu navegador no soporta el elemento de video.
          </video>
          <p>Descripción de la característica destacada.</p>
        </div>
      </section>

      {/* Contenedor de Contacto */}
      <section className="contact-container">
        <h2>Contáctanos</h2>
        <p>Si tienes alguna pregunta, no dudes en ponerte en contacto con nosotros.</p>
        <div className="contact-info">
          {/* Aquí puedes agregar más contenido, formularios o información adicional */}
        </div>
      </section>
    </div>
  );
}

export default Inicio;
